      SELECT DISTINCT - + 91 * col0, col0 / + + col2 + 5 + - 19 * col0 - + + col1 * + ( - + col0 ) AS col2 FROM tab0 (FORMAT parquet) AS cor0;
  - name: tab0

outputs:
